import React from 'react'
import './styles.css' ; 
import {Line} from 'react-chartjs-2' ; 
const App = () => {
    return (
        <Line 
        data = {{
            labels:["Abhinav" , "Ayush BRO"] ,
            datasets:[
                {
                    data:[0 , 90] , 
                    label:"Scores" , 
                    borderColor:"blue" , 
                    backgroundColor:"blue",
                    fill:true
                } , 
                {
                    data:[0 , 10] , 
                    label:"LOW" , 
                    borderColor:"red" , 
                    backgroundColor:"transparent",
                    fill:true
                }
            ]
        }}
        />
    )
}

export default App
